import Panel from "./Components/Panel";
import {panelData} from "./data/home_data";

function Home() {
    const panel = panelData.map(item => {
        return (
            <div>
                <Panel title={item.title} imgSrc={item.imgSrc} imgAlt={item.imgAlt} text={item.text}></Panel>
            </div>
        )
    })
    return (
        <div className="home">
            <div className="home__panel">
                <Panel ></Panel>
            </div>
        </div>
    )
}

export default Home;
